import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import "./imageslider.css" // Be sure to include the styles

function ImageSlider() {
  return (
    <Carousel>
      <div>
        <img src="pexels-gustavo-fring-3985062.jpg" alt="Image 1" />
      </div>
      <div>
        <img src="pexels-gustavo-fring-3985062.jpg" alt="Image 2" />
      </div>
      <div>
        <img src="pexels-gustavo-fring-3985062.jpg" alt="Image 3" />
      </div>
    </Carousel>
  );
}

export default ImageSlider;
